    return(
        <header> <h2>Sujeito programador</h2>
        <div className='menu'>
        <Link to="/Contato">Contato</Link>
        <Link to="/Sobre">Sobre</Link>
        <Link to="/">Home</Link>
        </div>
        </header>
        
    )
}

export default Header;
